import {makeStyles} from '@material-ui/core';


export const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        '& button.back-btn': {
            width: '250px',
            height: '40px',
            color: theme.palette.primary.white
        },
    }
}))
